import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Paper } from "@mui/material";
import { Divider } from "@material-ui/core";
import Button from "@mui/material/Button";
import PictureAsPdfIcon from "@mui/icons-material/PictureAsPdf";
export default function Resume() {
  return (
    // <Paper style={{ height: "100vh" }}>
    <>
      <MediaQuery maxWidth={1199}></MediaQuery>
      <div style={{ paddingLeft: "20rem", paddingRight: "5rem" }}>
        <div className="mt-4" style={{ textAlign: "center" }}>
          <h2 style={{ fontSize: "2rem" }}>
            <b>My Resume</b>
          </h2>
        </div>
        <div className="d-flex justify-content-center mt-3">
          <div style={{ marginRight: "1rem" }}>
            <a
              href="../Images/CV.jpg"
              download
              style={{ textDecoration: "none" }}
            >
              <Button
                style={{
                  backgroundColor: "#54B689",
                  height: "5vh",
                  width: "20rem",
                }}
                variant="contained"
                startIcon={<PictureAsPdfIcon />}
              >
                <b> Download PDF Version</b>
              </Button>
            </a>
          </div>
          <div style={{ marginLeft: "1rem" }}>
            <a
              href="..Record of Studies Omer Perez.pdf"
              download
              style={{ textDecoration: "none" }}
            >
              <Button
                style={{
                  backgroundColor: "#54B689",
                  height: "5vh",
                  width: "20rem",
                }}
                variant="contained"
                startIcon={<PictureAsPdfIcon />}
              >
                <b> Download Record of Studies</b>
              </Button>
            </a>
          </div>
        </div>
        <Divider
          className="mt-3"
          style={{ background: "white", height: "0.05rem" }}
        />
        <div className="d-flex justify-content-center mt-3 mb-3">
          <img
            src="../Images/CV.jpg"
            style={{
              width: "50rem",
              borderRadius: "2%",
              border: "2px solid blue",
              boxShadow:
                "rgba(0, 0, 0, 0.25) 0px 54px 55px, rgba(0, 0, 0, 0.12) 0px -12px 30px, rgba(0, 0, 0, 0.12) 0px 4px 6px, rgba(0, 0, 0, 0.17) 0px 12px 13px, rgba(0, 0, 0, 0.09) 0px -3px 5px",
            }}
          />
        </div>
      </div>
    </>
  );
}
